var currentImageIndex = 0;
var imageFrames;
var imageList = [];

function setupMainObstacle() {
  imageFrames = [
    "data:image/gif;base64,",
    "data:image/gif;base64,",
    "data:image/gif;base64,",
    "data:image/gif;base64,",
    "data:image/gif;base64,",
    "data:image/gif;base64,",
    "data:image/gif;base64,",
    "data:image/gif;base64,",
    "data:image/gif;base64,",
    "data:image/gif;base64,",
  ];
  //adds actual images from the frames to a list.
  for(var i = 0; i < imageFrames.length; i++){
      var image = new Image();
      image.src = imageFrames[i];
      imageList.push(image);
  }
}

function drawImage(context, x, y, width, height) {
  context.drawImage(imageList[currentImageIndex], x, y, width, height);
  currentImageIndex = (currentImageIndex + 1) % imageList.length;
}
